import React, { Component } from "react";

class RightArrowButon extends Component {
  render() {
    return (
      <div className="rightArrowButton" onClick={props.onRightClick}>
        <i className="fas fa-angle-right" aria-hidden="true" />
      </div>
    );
  }
}

export default RightArrowButon;
